import React, {Fragment} from 'react'

import Link from "next/link";

//Routes
import Home from './home'
import About from './about'


//Components
import Layout from '../components/layout'


const Index = () => {
    return (
      <Layout>
        <Link href="/">
            <Home/>
        </Link>
      </Layout>
    )
}

export default Index;
